import logo from './logo.svg';
import './App.css';
import Header from "./component/header/Header"
import MyNavbar from './component/header/Navbar';
import CarouselComponent from './component/header/Carousel';
import ShortsCarousel from "./component/header/Teamcard";
import Fpoa from "./component/hero/Fpoa";
import Card from "./component/hero/Card";




function App() {

  const magicMoments = [
    { title: "Goal by Messi", description: "Amazing goal in 90th min", image: "https://via.placeholder.com/300x180?text=Messi" },
    { title: "Ronaldo Header", description: "Powerful header goal", image: "https://via.placeholder.com/300x180?text=Ronaldo" }
  ];

  const pointTable = [
    { title: "Team A", description: "Points: 12 | Wins: 4 | Losses: 1" },
    { title: "Team B", description: "Points: 9 | Wins: 3 | Losses: 2" },
    { title: "Team C", description: "Points: 6 | Wins: 2 | Losses: 3" }
  ];


  return (
    <div>
    <Header/>  
    <MyNavbar/>
    <CarouselComponent/> 
    <div className="min-h-screen bg-[#0D1126] flex items-center justify-center p-6">
      <ShortsCarousel />
    </div>
    <Fpoa/>
    <Card/>
    <div className="App">
      <h2>âš½ Magic Moments</h2>
      <div className="card-container">
        {magicMoments.map((item, index) => (
          <Card key={index} {...item} />
        ))}
      </div>

      <h2>ðŸ“Š Point Table</h2>
      <div className="card-container">
        {pointTable.map((team, index) => (
          <Card key={index} {...team} />
        ))}
      </div>
    </div>
    </div>
  );
}

export default App;
